import React from 'react';
import './contact.css';
import { Button, Form, FormGroup, Label, Input} from 'reactstrap';

const Contact = (props) => {
  return (

    <Form className="contact">
        <h1>CONTACT</h1>
        <p className="lead">
              Pour toute demande ou suggestions n'hésitez pas à me contacter !
              </p>
      <FormGroup>
        <Label for="examplePassword">Nom/Prénom</Label>
        <Input type="text" name="text" id="exampleName" placeholder="Nom/Prénom" />
      </FormGroup>
      <FormGroup>
        <Label for="exampleEmail">Email</Label>
        <Input type="email" name="email" id="exampleEmail" placeholder="Email" />
      </FormGroup>
      <FormGroup>
        <Label for="examplePassword">Téléphone</Label>
        <Input type="text" name="text" id="exampleNumber" placeholder="Téléphone" />
      </FormGroup>
      <FormGroup>
        <Label for="exampleText">Message</Label>
        <Input type="textarea" name="text" id="exampleText" />
      </FormGroup>
      <Button>Envoyer</Button>
    </Form>
	);
};

export default Contact;
